import React from 'react';
import NavBar from './Components/NavBar';
import Footer from './Components/Footer';
import { Link, Route, Routes } from 'react-router-dom';
import Home from '../Pages/Home';


function App() {
    return (
        <>
          <header>
            <NavBar />
          </header>
          <main>
          <Routes>
                    <Route path='/' element={<Home />}></Route>
                </Routes>
          </main>
          <footer>
            <Footer />
          </footer>

        </>
    );
}

export default App;
